)

export default PastEvents;


const SearchResult = props => (
    <ul className="list-group search-result">
        {props.results.map(result => (
            <li className="list-group-item" key={result}>
                <img className="img-fluid" alt="dog" src={result} />
            </li>
        ))}
    </ul>
)
